import React, { Component } from 'react';

const styles = {
    container:{
        paddingTop: "50px",
        paddingBottom: "50px",
        paddingLeft: "0px",
        paddingRight: "0px",
        display: "flex",
        flexWrap: "wrap",
        margin: "0 auto",
        justifyContent: "center",
    }
};

class Game extends Component {



    render() {
        return (
            <main className="container" id="gameBoard" style={styles.container}>
                {console.log(this.props.theDate)}
                <div>
                    Yes
                </div>
                <div>
                    No
                </div>
            </main>
        );
    };
}

export default Game;
